import React from 'react'
import infoArr from "../../infoArr"
const Booklist = () => {

    return (
        <div>
            {
                infoArr.map((info) => {
                    return (
                        <h1>{info.bookName}</h1>
                    )
                })
            }

        </div>
    )
}

export default Booklist
